Salsa 的目标是支持高效的 增量重新 (incremental recomputation) 计算。 例如， Salsa 用于 rust-analyzer ，以帮助它在你输入东西时快速重新编译你的程序。 Salsa 项目的基本理念是这样的： let mut input = ...;
loop { let output = your_program(&input); modify(&mut input);
} 从输入某个值开始：你可以调用程序来返回结果，一段时间后，你修改输入并再次调用你的程序。 我们的目标是 通过重用第一次调用的一些结果来加快第二次调用的速度 。 当然，在现实中，你可以有许多输入，“你的程序”可能是在这些输入上定义的许多不同的方法和函数。 但这段代码仍然传达了几个重要的概念： Salsa 从定义了输入的某个外部循环中分离出“增量计算”（即函数 your_program) Salsa 为你提供了定义 your_program 的工具 Salsa 假定 your_program 是其输入的一个完全的确定性函数 （deterministic ，即每次给定相同的输入，输入的结果必须完全确定），否则整个设置没有意义 作为这个主循环的一部分，输入的变化总是发生在 your_program 之外

