解析器的起点是 parse_statements 函数： #[salsa::tracked]
pub fn parse_statements(db: &dyn crate::Db, source: SourceProgram) -> Program { // Get the source text from the database let source_text = source.text(db); // Create the parser let mut parser = Parser { db, source_text, position: 0, }; // Read in statements until we reach the end of the input let mut result = vec![]; loop { // Skip over any whitespace parser.skip_whitespace(); // If there are no more tokens, break if parser.peek().is_none() { break; } // Otherwise, there is more input, so parse a statement. if let Some(statement) = parser.parse_statement() { result.push(statement); } else { // If we failed, report an error at whatever position the parser // got stuck. We could recover here by skipping to the end of the line // or something like that. But we leave that as an exercise for the reader! parser.report_error(); break; } } Program::new(db, result)
} 此函数标注了 #[salsa::traced]。这意味着，当它被调用时， Salsa 将跟踪它读取的输入以及返回的值。 返回值被存储下来 (memoized)，这意味着如果再次调用此函数而不更改输入， Salsa 将只克隆结果，而不是重新执行这个函数。

