} 当你调用一个跟踪函数时，salsa 将跟踪它访问了哪些输入（在本例中为 file.content(db)）。 它还将记录返回值（在本例中为 Ast）。 如果你调用一个跟踪函数两次， salsa 会检查输入是否已更改；如果没有更改，它可以返回存储的值 (memoized value) 。 Salsa 使用“ 红绿算法 ”决定何时需要重新执行跟踪函数，这就是 Salsa 这个名字的由来 [3] 。 译者注：“红绿”这种鲜艳的颜色搭配会让人想起 salsa 这种墨西哥辣番茄酱。 跟踪函数必须遵循特定的结构： 必须把对数据库的 & 引用作为第一个参数。 注意，因为这是一个 & 引用，所以不可能在跟踪函数期间创建或修改输入！ 必须将 "salsa struct" 作为第二个参数 在上述示例中，这是一个输入结构，但我们将简短地描述其他类型的 salsa 结构 可以接受其他参数，但如果不接受，速度会更快，而且更好。 跟踪函数可以返回任何可克隆 (clone-able) 的类型。需要克隆，因为在缓存值时，会从数据库中克隆出结果。 如果你希望从数据库返回引用，则跟踪函数也可以使用 #[return_ref] 进行标注。例如，如果 parse_file 函数被这样注释，那么调用者实际上会得到 &Ast。

