There is one catch in the above setup. The user's code always interacts with a dyn crate::Db value, where crate::Db is the trait defined by the jar; the crate::Db trait extends salsa::HasJar which in turn extends salsa::Database. Ideally, we would have salsa::Database extend salsa::HasJars, which is the main trait that gives access to the jars data. But we don't want to do that because HasJars defines an associated type Jars, and that would mean that every reference to dyn crate::Db would have to specify the jars type using something like dyn crate::Db<Jars = J>. This would be unergonomic, but what's worse, it would actually be impossible: the final Jars type combines the jars from multiple crates, and so it is not known to any individual jar crate. To workaround this, salsa::Database in fact extends another trait, HasJarsDyn, that doesn't reveal the Jars or ingredient types directly, but just has various method that can be performed on an ingredient, given its IngredientIndex. Traits like Ingredient<DB> require knowing the full DB type. If we had one function ingredient directly invoke a method on Ingredient<DB>, that would imply that it has to be fully generic and only instantiated at the final crate, when the full database type is available. We solve this via the HasJarsDyn trait. The HasJarsDyn trait exports a method that combines the "find ingredient, invoking method" steps into one method: /// Dyn friendly subset of HasJars
pub trait HasJarsDyn { fn runtime(&self) -> &Runtime; fn runtime_mut(&mut self) -> &mut Runtime; fn maybe_changed_after(&self, input: DependencyIndex, revision: Revision) -> bool; fn cycle_recovery_strategy(&self, input: IngredientIndex) -> CycleRecoveryStrategy; fn origin(&self, input: DatabaseKeyIndex) -> Option<QueryOrigin>; fn mark_validated_output(&self, executor: DatabaseKeyIndex, output: DependencyIndex); /// Invoked when `executor` used to output `stale_output` but no longer does. /// This method routes that into a call to the [`remove_stale_output`](`crate::ingredient::Ingredient::remove_stale_output`) /// method on the ingredient for `stale_output`. fn remove_stale_output(&self, executor: DatabaseKeyIndex, stale_output: DependencyIndex); /// Informs `ingredient` that the salsa struct with id `id` has been deleted. /// This means that `id` will not be used in this revision and hence /// any memoized values keyed by that struct can be discarded. /// /// In order to receive this callback, `ingredient` must have registered itself /// as a dependent function using /// [`SalsaStructInDb::register_dependent_fn`](`crate::salsa_struct::SalsaStructInDb::register_dependent_fn`). fn salsa_struct_deleted(&self, ingredient: IngredientIndex, id: Id); fn fmt_index(&self, index: DependencyIndex, fmt: &mut fmt::Formatter<'_>) -> fmt::Result;
} So, technically, to check if an input has changed, an ingredient: Invokes HasJarsDyn::maybe_changed_after on the dyn Database The impl for this method (generated by #[salsa::db]): gets the route for the ingredient from the ingredient index uses the route to get a &dyn Ingredient invokes maybe_changed_after on that ingredient

